import React from 'react';
import Track from '../Track/Track';
import './TrackList.css';


class TrackList extends React.Component {

    renderTracks(searchResults){

      const tracks = []
      Object.keys(searchResults).map(track =>{
        const song = searchResults[track];
        console.log(`title: ${song.name}
          artist: ${song.artist}`);
        return <Track name={song.name} artist={song.artist} album={song.album} key={song.id} />;

      }).push(tracks);
      return tracks;


  }



      render(){
         return (
           <div className="TrackList">
             {this.renderTracks(this.props.searchResults)}
           </div>

         );
      }
  }

export default TrackList;
